import React from 'react';
import ReactDOM from 'react-dom';

function createUl(listItemsCount) {
    let li;
    for(let i = 0; i < listItemsCount; i++){
        li += <li>i</li>;
    }
    return <ul>li</ul>
}

ReactDOM.render(<h1>Hello, world!</h1>, document.getElementById('root'));
